if (document.getElementById("startPage")) return;

let loadInterval = setInterval(() => {
    if (document.getElementById("loadingScreen").classList.contains("hidden")) {
        clearInterval(loadInterval);
    }
}, 500);

let volume = 0.7;
let x = true;

let lastGain;
let xpIntoLevel;

// SET VOICE LINES

let morning=new Audio("data:audio/mpeg;base64,");
let afternoon=new Audio("data:audio/mpeg;base64,");
let evening=new Audio("data:audio/mpeg;base64,");
let night=new Audio("data:audio/mpeg;base64,");
let join=new Audio("data:audio/mpeg;base64,");
let leave1=new Audio("data:audio/mpeg;base64,");
let leave2=new Audio("data:audio/mpeg;base64,");
let start1=new Audio("data:audio/mpeg;base64,");
let start2=new Audio("data:audio/mpeg;base64,");
let arigato=new Audio("data:audio/mpeg;base64,");
let roll=new Audio("data:audio/mpeg;base64,");
let popout=new Audio("data:audio/mpeg;base64,");
let message=new Audio("data:audio/mpeg;base64,");
let settings=new Audio("data:audio/mpeg;base64,");

morning.volume=volume;
afternoon.volume=volume;
evening.volume=volume;
night.volume=volume;
join.volume=volume;
leave1.volume=volume;
leave2.volume=volume;
start1.volume = volume;
start2.volume = volume;
roll.volume=volume;
arigato.volume=volume;
popout.volume=volume;
settings.volume=volume;
message.volume=volume;
message.volume=volume;
message.volume=volume;

let now = new Date();
let hour = now.getHours();

// LOGIN VOICE LINE BASED ON TIME

if(hour >= 8 && hour < 12){
    morning.play()
}
else if(hour >= 12 && hour < 18){
    afternoon.play()
}
else if(hour >= 18){
    evening.play()
}
else if(hour >=0 && hour < 8){
    night.play()
}

// When User join a game
let JoinGame = new Listener("Join Game", (payload) => {
    if(quiz.gameMode === 'Ranked') return;
    join.play()
});
// When another Player leave
let PlayerLeft = new Listener("Player Left", (payload) => {
    if(quiz.gameMode === 'Ranked') return;
    x ? leave1.play() : leave2.play();
    x = !x;
});
// When the game start
let GameStart = new Listener("Game Starting", (payload) =>{
    x ? start1.play() : start2.play();
    x = !x;
});
// When rolling for skins
let TicketRoll = new Listener("ticket roll result", (payload) => {
    roll.play()
});
// When leveling up
let LevelUp = new Listener("quiz xp credit gain", (payload) => {
    let lastGain = payload.xpInfo.lastGain;
    let xpIntoLevel = payload.xpInfo.xpIntoLevel;
    if(lastGain > xpIntoLevel){
        arigato.play()
    }
});
// When there is a popout
let Popout = new Listener("popout message", (payload) => {
    popout.play()
});
    // When changing room settings
let Setting = new Listener("Room Settings Changed", (payload) => {
    settings.play()
});
// When receiving DM
let Message = new Listener("chat message", (payload) => {
    message.play()
});
// When receiving friend request
let FriendRequest = new Listener("new friend request recived", (payload) => {
    message.play()
});
// When receiving game invite
let GameInvite = new Listener("game invite", (payload) => {
    message.play()
});

JoinGame.bindListener();
PlayerLeft.bindListener();
GameStart.bindListener();
TicketRoll.bindListener();
LevelUp.bindListener();
Popout.bindListener();
Setting.bindListener();
Message.bindListener();
FriendRequest.bindListener();
GameInvite.bindListener();
